import { Container, Row } from "react-bootstrap";
import "./ChapterPage.css";

const ChapterPage = () => {
  return (
    <>
      <div className="chapter-wraper">
        <Container>
          <Row></Row>
        </Container>
      </div>
    </>
  );
};

export default ChapterPage;
